DictionaryEntry.create!([
  {name: "Community Type",                               code: "Community Type",                               description: "Numerical code and name of municipality's community type", importance: nil, interpretation: "Numerical code and name of municipality's community type", technical_notes: "None", order: 5},
  {name: "MAPC Region",                                  code: "MAPC Region",                                  description: "Identifies whether a station area is within MAPC's regional boundary", importance: "The Metropolitan Area Planning Council is the regional planning agency serving 101 cities and towns. ", interpretation: "Identifies whether a station area is within MAPC's regional boundary", technical_notes: "None", order: 6},
  {name: "Municipality",                                 code: "Municipality",                                 description: "Name of municipality in which the station is located", importance: "The station areas for which Information Station provides data are located in 91 different municipalities in the Boston region.  Each municipality has different growth projections, demographics, character, transportation assets, and travel patterns, all of which can impact station area development.", interpretation: "Name of municipality in which the station is located", technical_notes: "None", order: 7},
  {name: "Station Name",                                 code: "Station Name",                                 description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 8},
  {name: "Service Type",                                 code: "Service Type",                                 description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 9},
  {name: "Station Type",                                 code: "Station Type",                                 description: nil, importance: "Many station areas share similar attributes, challenges, and opportunities and may benefit from similar strategies, investments, and design approaches. The analysis MAPC conducted to create the typology also demonstrates that the regions station areas are positioned to be a significant component of the regions growth and development over the coming decades.  The role envisioned for station areas in absorbing future growth varies for each station area type.  For example, Neighborhood Subway station areas are located in predominantly residential, moderate-density, transit neighborhoods in the regions Inner Core, and new development is likely to occur through small-scale infill development.  In contrast, Suburban Transformation station areas are likely to experience transformative TOD through a major planned development around a commuter rail station. Use the websites Search function to browse station areas of the same type.", interpretation: "Many station areas share similar attributes, challenges, and opportunities and may benefit from similar strategies, investments, and design approaches. The analysis MAPC conducted to create the typology also demonstrates that the regions station areas are positioned to be a significant component of the regions growth and development over the coming decades.  The role envisioned for station areas in absorbing future growth varies for each station area type.  For example, Neighborhood Subway station areas are located in predominantly residential, moderate-density, transit neighborhoods in the regions Inner Core, and new development is likely to occur through small-scale infill development.  In contrast, Suburban Transformation station areas are likely to experience transformative TOD through a major planned development around a commuter rail station. Use the websites Search function to browse station areas of the same type.", technical_notes: "None", order: 10},
  {name: "eTOD Score",                                   code: "eTOD Score",                                   description: nil, importance: "A station areas eTOD Score and eTOD Type reflect how well a station area performs in reducing driving, a key measure of the performance of  successful  transit-oriented development.  The total (composite) eTOD score rates a station areas performance on all three components of equitable TOD: Transit and other non-automobile means of transportation; Orientation toward transit-oriented neighbors who make up the core of transit ridership; and Development characterized by high levels of walkability and density. The eTOD Type categorizes station areas with similar scores. The composite score ranges from 10 (lowest possible value on all ten attributes) to 50 (highest possible value on all ten attributes).", interpretation: "The composite score ranges from 10 (lowest possible value on all ten attributes) to 50 (highest possible value on all ten attributes). The eTOD Score rating system places station areas with a score of 41-50 in the Transit-Oriented group; those scoring between 31-40 are considered Transit-Supportive; a score of 21-30 defines the Transit-Related group; and Transit-Adjacent station areas are t those scoring 20 or below. A station area does not need to be in the top quintile on all measures in order to qualify in the top score range. The best-ranking station areas tend to be denser areas in the inner core of the region served by rapid transit (Back Bay, Harvard Square) or multiple high frequency bus lines (Dudley Square). Transit-Oriented station areas are considered excellent candidates for equitable TOD. Transit-Supportive station areas may need particular deficiencies to be addressed, as revealed by their sub-scores, in order to become more transit-oriented. Transit-Related station areas will likely need multiple deficiencies addressed. Transit-Adjacent station areas differ very little (or not at all) in driving behavior from surrounding areas with no transit.", technical_notes: "None", order: 11},
  {name: "eTOD Group",                                   code: "eTOD Group",                                   description: nil, importance: "The eTOD Score rating system places station areas with a score of 41-50 in the Transit-Oriented group; those scoring between 31-40 are considered Transit-Supportive; a score of 21-30 defines the Transit-Related group; and Transit-Adjacent station areas are t those scoring 20 or below. ", interpretation: nil, technical_notes: "None", order: 12},
  {name: "Transit Score",                                code: "Transit Score",                                description: nil, importance: "All station areas in the data set are assigned a transit quality score based on the scores for transit access, connectivity, and non-car commuting. Higher scores indicate that the transit service in the station area is frequent, fast, and connected to essential destinations, relative to its peers. The best-ranking station areas tend to be denser areas in the inner core of the region served by rapid transit (Back Bay, Harvard Square) or multiple high frequency bus lines (Dudley Square). Offering more transit service (more stops, more frequent service, or more connections to other transit services), thereby increasing the area reachable via transit, or making existing service more appealing to residents, thereby increasing transit use, would improve a station areas score on this measure. ", interpretation: nil, technical_notes: "None", order: 13},
  {name: "Orientation Score",                            code: "Orientation Score",                            description: nil, importance: "All station areas in the data set are assigned an orientation score based on its scores for zero-car households, low-income households, proportion of households that rent instead of own, and estimated transportation costs that are affordable. Higher scores indicate that the station area is well-oriented toward core riders, relative to its peers. ", interpretation: nil, technical_notes: "None", order: 14},
  {name: "Development Score",                            code: "Development Score",                            description: nil, importance: "All station areas in the data set are assigned a development score based on its scores for walkability, residential density, and access to employment opportunities. Higher scores indicate that the area does well on these three measures relative to its peers. ", interpretation: nil, technical_notes: "None", order: 15},
  {name: "Community Subtype",                            code: "Community Subtype",                            description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 16},
  {name: "VMT",                                          code: "VMT",                                          description: nil, importance: "The average vehicle miles travelled per household in the station area, based on vehicle registrations and mileage recorded during annual safety inspections. ", interpretation: nil, technical_notes: "None", order: 17},
  {name: "Transit Commuter Share",                       code: "Transit Commuter Share",                       description: nil, importance: "The share of commuters who use transit is one of the strongest indicators of the quality and frequency of transit service in a station area, but is also influenced by income, the cost of gasoline, the availability and cost of parking, and other factors. Since commuting is a major source of household VMT, shifting commuting miles from driving to transit reduces overall driving among the residents of a station area.  ", interpretation: nil, technical_notes: "None", order: 18},
  {name: "Vehicle Ownership",                            code: "Vehicle Ownership",                            description: nil, importance: "Vehicle ownership in station areas is low in the Boston region as a whole, with an average of 0.9 vehicles per household, reflecting the abundance of high-quality options that compete well with driving.  The highest average rate of car ownership for all stations of a given type is 1.5 vehicles per household in Undeveloped station areas, followed by Suburban Transformation station areas (1.4) and Commerce Parks (1.3).  Other types of station areas have far lower average vehicle ownership:  the Metro Core group comes in at 0.4 vehicles per household, followed by the Seaport/Airport group (0.5) and Neighborhood Subways (0.6).", interpretation: nil, technical_notes: "None", order: 19},
  {name: "Transit Share of Commuting miles",             code: "Transit Share of Commuting miles",             description: nil, importance: "The share of commuting miles undertaken on transit provides a way to view differences in transit commuting among station areas and their impacts, particularly environmental impacts, as well as regional efforts to shift work trips from cars to transit.  For example, if the share of commuters using transit is holding steady or growing in a given station area (see OV_PCTTRAN), while the transit share of commuting miles is eroding, this could indicate that transit is attracting short-distance commuters more than longer-distance commuters or even that the rise in short-distance transit commuting is freeing up road capacity that encourages longer-distance commuters to drive. At the regional level, this same combination of indicators could point to changes in workplace location patterns that cause some workers to drive longer and longer distances. ", interpretation: nil, technical_notes: "None", order: 20},
  {name: "Greenhouse Gas Emissions from transportation", code: "Greenhouse Gas Emissions from transportation", description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 21},
  {name: "Floor Area Ratio (FAR)",                       code: "Floor Area Ratio (FAR)",                       description: nil, importance: "Higher FAR values generally indicate greater density, however note that buildings of various heights can have the same FAR depending on how much of the lot they occupy.  For example, on a 5,000 square foot lot (somewhat larger than a basketball court), a minimum allowable FAR of 2.0 could be achieved with a building of two stories with 5,000 square feet on each floor, or four stories tall with 2,500 square feet per floor, and so on. The values provided in this dataset reflect current average FAR for existing buildings, not regulated minima or maxima.  The average FAR for all station areas in the region is 0.5.  The vast majority of station areas with an average FAR of 1.0 or higher are located in the city of Boston, along with a few in Cambridge, Somerville, and Brookline, and one in Lawrence.", interpretation: nil, technical_notes: "None", order: 22},
  {name: "Surface Parking (acre)",                       code: "Surface Parking (acre)",                       description: nil, importance: "On average, the regions station areas have 45 acres of surface parking.  Station areas classified as Undeveloped and Trolley Suburbs have the smallest amount of surface parking, at 20 acres and 18 acres, respectively.  Many of the station areas with less than 10 acres of surface parking are located in maturing suburbs such as Hull, Needham, Weston, and Lincoln. The station area types with the largest average amount of surface parking are Commerce Park (83 acres), Transformational Subway (81), Seaport/Airport (80), and Urban Gateway (71). These four types each include several station areas with more than 100 acres of surface parking, though note that this acreage may not be contiguous.", interpretation: nil, technical_notes: "None", order: 23},
  {name: "Current Development Intensity",                code: "Current Development Intensity",                description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 24},
  {name: "Current Development Mix",                      code: "Current Development Mix",                      description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 25},
  {name: "Net Residential Density",                      code: "Net Residential Density",                      description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 26},
  {name: "Net Employment Density",                       code: "Net Employment Density",                       description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 27},
  {name: "Underutilized Land",                           code: "Underutilized Land",                           description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 28},
  {name: "Zoning",                                       code: "Zoning",                                       description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 29},
  {name: "Walkscore",                                    code: "Walkscore",                                    description: nil, importance: "WalkScore measures the walkability of any address. For station areas in Informa?ion Station, the address used is the stations latitude and longitude. According to the creators of WalkScore, a neighborhood with a score between 90-100 is considered a Walkers Paradise, where daily errands do not require a car.  Examples in the Boston area include downtown Boston neighborhoods such as South End, much of Somerville, and the central parts of Quincy, Waltham, and Lynn. An area with a score between 70-89 is Very Walkable, such that most errands can be accomplished on foot. Examples include Jamaica Plain in Boston and the central parts of Norwood and Malden. A score between 50-69 means that an area is Somewhat Walkable, which allows some errands to be accomplished on foot.  Examples include Mattapan in Boston, and Wilmington. In Car Dependent areas that score between 25-49 (e.g. North Waltham and much of Weymouth), most errands require a car; below that score (e.g. Milton, much of Franklin), almost all errands require a car.", interpretation: "WalkScore measures the walkability of any address. For station areas in Informa?ion Station, the address used is the stations latitude and longitude. According to the creators of WalkScore, a neighborhood with a score between 90-100 is considered a Walkers Paradise, where daily errands do not require a car.  Examples in the Boston area include downtown Boston neighborhoods such as South End, much of Somerville, and the central parts of Quincy, Waltham, and Lynn. An area with a score between 70-89 is Very Walkable, such that most errands can be accomplished on foot. Examples include Jamaica Plain in Boston and the central parts of Norwood and Malden. A score between 50-69 means that an area is Somewhat Walkable, which allows some errands to be accomplished on foot.  Examples include Mattapan in Boston, and Wilmington. In Car Dependent areas that score between 25-49 (e.g. North Waltham and much of Weymouth), most errands require a car; below that score (e.g. Milton, much of Franklin), almost all errands require a car.", technical_notes: "None", order: 30},
  {name: "Residential Pipeline",                         code: "Residential Pipeline",                         description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 31},
  {name: "Commercial Pipeline",                          code: "Commercial Pipeline",                          description: nil, importance: nil, interpretation: nil, technical_notes: "None", order: 32},
